    'description': 'As an introducer, we connect clients with trusted and licensed
      insurance brokers who provide access to a comprehensive suite of insurance solutions.  Our
      offerings help address key wealth objectives, from personal protection and estate
      planning to legacy transfer and business continuity.  With a growing range of
      investment-linked insurance products, including solutions that allow portfolio
      management within the policy, UOB Kay Hian is uniquely positioned to support
      a holistic and integrated wealth management approach for clients.'
